English | CBR | 2 Issues

Birds of Prey v3 #24-25
Publisher:  DC Comics
Publication Date:  October 16, 2013 - November 20, 2013

Writer:  Christy Marx
Pencillers:  Romano Molenaar and Robson Rocha (#24), Romano Molenarr, Daniel Sampere, and Travis Moore (#25)
Inkers:  Jonathan Glapion (#24-25), Oclair Albert (#24), and Vicent Cifuentes (#25)
Colorist:  Chris Sotomayor
Letterer:  Dezi Sienty
Cover Art:  Jorge Molina

Birds of Prey #24
The Birds are up against impossible odds as Canary must free her suddenly alive husband, Kurt, from Regulus, while Batgirl and Strix infiltrate the Basilisk compound.

Birds of Prey #25
A BATMAN: ZERO YEAR tie-in! Look into a pivotal moment in Black Canary's history--filled with assassins, mystery men, and an ancient evil in Gotham City.

Thanks goes to G85 for this release.

